class Solution(object):
    def maximumSum(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        from collections import defaultdict
        from math import sqrt

        def get_mask(num):
            mask = 0
            for i in range(2, int(sqrt(num)) + 1):
                if num % i == 0:
                    cnt = 0
                    while num % i == 0:
                        num //= i
                        cnt += 1
                    if cnt % 2:
                        mask ^= 1 << i
            if num > 1:
                mask ^= 1 << num
            return mask

        masks = defaultdict(int)
        for num in nums:
            masks[get_mask(num)] += num

        return max(masks.values())
